import React, { Component } from 'react'

//클래스 형 컴포넌트
//class 클래스명 extends 상속자명
//render 반드시 필요
class App extends Component {

    num = 0;

    addNum = () => {
        setInterval(()=>{
            this.num = this.num + 1;
        },
        1000);
    }
    constructor() {
        this.addNum();
    }

    render() {
        return (
            //test라는 렌더요소 정의
            <div>
                Test {this.num}
            </div>
        )
    }
}

export default App;
